WITH individual AS (
    SELECT id AS lesson_id FROM lesson
    WHERE lesson_type='individual'
    ORDER BY random()
),
groups AS (
    SELECT id AS lesson_id FROM lesson
    WHERE lesson_type='group'
    ORDER BY random()
),
ensemble_jan_2023_next_week AS (
    SELECT id AS lesson_id FROM lesson 
    WHERE lesson_type='ensemble'
    AND start_time BETWEEN '2023-01-09' AND '2023-01-16'
    ORDER BY random()
),
ensemble_remaining AS (
    SELECT id AS lesson_id FROM lesson
    WHERE lesson_type='ensemble'
    AND start_time NOT BETWEEN '2023-01-09' AND '2023-01-16'
    ORDER BY random()
)
